<div class="entities" style="line-height: 2.5; direction: ltr">Array-comparative genomic hybridization to detect genomewide changes in microdissected primary and metastatic oral squamous cell carcinomas . Oral squamous cell carcinoma ( OSCC ) is a common worldwide malignancy . However , it is unclear what , if any , genomic alterations occur as the disease progresses to invasive and metastatic OSCC . This study used genomewide array-CGH in microdissected specimens to map genetic alterations found in primary OSCC and neck lymph node metastases . We used array-based comparative genomic hybridization ( array-CGH ) to screen genomewide alterations in eight pairs of microdissected tissue samples from primary and metastatic OSCC . In addition , 25 primary and metastatic OSCC tissue pairs were examined with immunohistochemistry for protein expression of the most frequently altered genes . The highest frequencies of gains were detected in P12524 ,

<div class="entities" style="line-height: 2.5; direction: ltr">LG839 : anti-obesity effects and polymorphic gene correlates of reward deficiency syndrome . INTRODUCTION : This study systematically assessed the weight management effects of a novel experimental DNA-customized nutraceutical , LG839 ( LifeGen , Inc . , La Jolla , CA , USA ) . METHODS : A total of 1058 subjects who participated in the overall D . I . E . T . study were genotyped and administered an LG839 variant based on polymorphic outcomes . A subset of 27 self-identified obese subjects of Dutch descent , having the same DNA pattern of four out of the five candidate genes tested ( chi-square analysis ) as the entire data set , was subsequently evaluated . Simple t tests comparing a number of weight management parameters before and after 80 days of treatment with LG839 were performed . RESULTS : Significant results were observed for weight loss , sugar craving reduction , appetite suppression , snack reduction , reduction of late night eating ( all P &lt; 0.01 ) , increased perception of overeating , enhanced quality of sleep , increased happiness ( all P &lt; 0.05 ) , and increased energy ( P &lt; 0.001 ) . Polymorphic correlates were obtained for a number of genes (
